```java
public class CallerClassExample {

    public static void main(String[] args) {
        \/\/ Get the current stack trace
        StackTraceElement[] stackTrace = Thread.currentThread().getStackTrace();

        \/\/ Iterate through the stack trace to find the caller's class
        String callerClassName = null;
        for (StackTraceElement element : stackTrace) {
            \/\/ Check if the class is not part of our own code
            if (!element.getClassName().startsWith("CallerClassExample")) {
                \/\/ Found the caller's class
                callerClassName = element.getClassName();
                break;
            }
        }

        \/\/ Print the caller's class name
        System.out.println("Caller's Class: " + callerClassName);
    }
}
```

In this example, the `main()` method calls the `getStackTrace()` method to obtain the stack trace. Then, it iterates through the stack trace elements until it finds the first class that is not part of the `CallerClassExample` class. Finally, it prints the name of the caller's class.

