      this.operand1 = parseFloat(this.displayValue);
      this.displayValue = '0';
    } else if (value === '.' && this.displayValue.indexOf('.') === -1) {
      this.displayValue += '.';
    } else if (value === '=' && this.operand1 !== null && this.operator !== null) {
      const operand2 = parseFloat(this.displayValue);
      switch (this.operator) {
        case '+':
          this.displayValue = (this.operand1 + operand2).toString();
          break;
        case '-':
          this.displayValue = (this.operand1 - operand2).toString();
          break;
        case '*':
          this.displayValue = (this.operand1 * operand2).toString();
          break;
        case '\/':
          this.displayValue = (this.operand1 \/ operand2).toString();
          break;
      }
      this.operand1 = null;
      this.operator = null;
    } else {
      if (this.displayValue === '0') {
        this.displayValue = '';
      }
      this.displayValue += value;
    }
  }
}
```

