To create a table data structure in Rust with constant time selection based on data contents, you can use a combination of hash maps and structs. A hash map allows for constant time lookup based on a key, which can mimic the row identification in a database table.

Here's an example that demonstrates a simple table with two columns: an ID (as the hash map key) and a value. You can extend this to add more columns\/fields to the struct as required.

```rust
use std::collections::HashMap;

#[derive(Debug)]
struct TableRow {
    id: u32,
    value: String,
}

struct Table {
    data: HashMap<u32, TableRow>,
}

impl Table {
    pub fn new() -> Table {
        Table {
            data: HashMap::new(),
        }
    }

    pub fn insert(&mut self, row: TableRow) {
        self.data.insert(row.id, row);
    }

    pub fn find(&self, id: &u32) -> Option<&TableRow> {
        self.data.get(id)
    }
}

fn main() {
    let mut table = Table::new();

    table.insert(TableRow { id: 1, value: "row 1 value".to_string() });
    table.insert(TableRow { id: 2, value: "row 2 value".to_string() });

    let row1 = table.find(&1);
    let row2 = table.find(&2);

    println!("Row 1: {:?}", row1);
    println!("Row 2: {:?}", row2);
}
```

This example defines the `TableRow` struct, representing a single row in the table. The `Table` struct has a private `HashMap` called `data` that stores the rows. The `insert` function adds rows to the `data` hash map, and the `find` function returns an `Option` of the row with the specific `id`.

You can extend this table structure by adding more fields to the `TableRow` struct, and you can add more methods to the `Table` struct to implement various operations like deleting a row, updating a row, or selecting rows based on a condition (which will no longer be constant time since it requires iterating over the hash map).

