class DAG:
    def __init__(self):
        self.graph = {}

    def add_edge(self, u, v, weight):
        if u not in self.graph:
            self.graph[u] = []
        self.graph[u].append((v, weight))

    def dfs(self, node, target, visited, memo):
        if node == target:
            return 0

        if node in memo:
            return memo[node]

        visited.add(node)
        max_score = float('-inf')

        if node in self.graph:
            for neighbor, weight in self.graph[node]:
                if neighbor not in visited:
                    score = self.dfs(neighbor, target, visited, memo)
                    if score != float('-inf'):
                        max_score = max(max_score, score + weight)

        visited.remove(node)
        memo[node] = max_score

        return max_score


def calculate_max_score(start, end, dictionary):
    if len(start) != len(end):
        return "Invalid input"

    dag = DAG()
    for word in dictionary:
        if len(word) == len(start):
            dag.add_edge(start, word, 0)

    for i in range(len(start)):
        for word in dictionary:
            if len(word) == len(start) and word != start:
                diff_count = sum(s != w for s, w in zip(start, word))
                if diff_count == 1:
                    dag.add_edge(start, word, abs(ord(start[i]) - ord(word[i])))

    visited = set()
    memo = {}
    max_score = dag.dfs(start, end, visited, memo)

    return max_score if max_score != float('-inf') else "No path found"


