            .or_insert(Vec::new())
            .push(index_entry);
        self.data.push(row);
    }

    \/\/ Retrieve rows based on name
    fn select_by_name(&self, name: &str) -> Option<Vec<&Row>> {
        if let Some(indices) = self.index.get(name) {
            let rows: Vec<&Row> = indices.iter().map(|&i| &self.data[i]).collect();
            Some(rows)
        } else {
            None
        }
    }
}

fn main() {
