To read a file into a string in C++, you can use the `std::ifstream` class to open the file, read its content, and store it into a string. Here's an example code snippet:

```cpp
#include <iostream>
#include <fstream>
#include <sstream>

std::string readFileToString(const std::string& filename) {
    std::ifstream file(filename);
    if (!file.is_open()) {
        std::cerr << "Failed to open file: " << filename << std::endl;
        return "";
    }

    std::stringstream buffer;
    buffer << file.rdbuf();
    file.close();

    return buffer.str();
}

int main() {
    std::string filename = "example.txt";
    std::string fileContent = readFileToString(filename);

    if (fileContent.empty()) {
        std::cerr << "File content is empty." << std::endl;
        return 1;
    }

    std::cout << "File content: " << std::endl;
    std::cout << fileContent << std::endl;

    return 0;
}
```

In this example, the `readFileToString` function takes the filename as input and returns a string containing the content of the file. The function first opens the file using `std::ifstream`. If the file opening fails, it displays an error message and returns an empty string.

If the file is successfully opened, the function creates a `std::stringstream` object called `buffer`. It then uses the `rdbuf` function to read the file content into `buffer`. Finally, it closes the file and returns the string representation of `buffer` using `str` function.

In the `main` function, you can specify the filename you want to read by assigning it to the `filename` variable. The content of the file is stored in the `fileContent` variable, which is then displayed using `std::cout`.

